import React from "react";
import { BrowserRouter as Router, Route, Link } from "react-router-dom";
import { Header, HeaderLi, HeaderLogo, HeaderUl } from "./home-components";
import Logo from "./icon/photo-logo.jpg";
import "./app.css"
import About from "./components/About"
import Contacts from "./components/Contacts"
import Portfolio from "./components/Portfolio"
import Skils from "./components/Skils"
function App() {
  const qwerty = ()=>{
    console.log(window.location.origin)
  }
  return (
    <div>
      <Router>
        <Header>
          <HeaderLogo>
            <img src={Logo} alt="" style={{ width: "60px", height: "60px", borderRadius: "50%" }} />
            <h1 style={{ color: "#fff" }}>Ozodbek</h1>
          </HeaderLogo>
          <HeaderUl>
            <Link to="/" style={{ textDecoration: 'none' }}><HeaderLi onclick={qwerty}>Oбо мне</HeaderLi></Link>
            <Link to="/skils" style={{ textDecoration: 'none' }}><HeaderLi>Изучал </HeaderLi></Link>
            <Link to="/portfolio" style={{ textDecoration: 'none' }}><HeaderLi>Портфолио </HeaderLi></Link>
            <Link to="/contacts" style={{ textDecoration: 'none' }}><HeaderLi>Контакты </HeaderLi></Link>
          </HeaderUl>
        </Header>

        <Route path="/" exact component={About}/>
        <Route path="/contacts" component={Contacts} />
        <Route path="/skils" exact component={Skils} />
        <Route path="/portfolio" component={Portfolio} />
      </Router>
    </div>
  );
}

export default App;
